🎥🎥🎥 Behind the scenes on @accusedfox written and directed by the brilliant @tazbah starring a cast of of powerhouse Indigenous, predominantly Navaho actors 🎥🎥

Posting this to encourage you to watch the drama unfold in this episode of @accusedfox - when @tazbah asked me to be a part of this I jumped at the opportunity. I hadn’t had time to be in front of the camera for a while. When I read the script I knew I had to make it happen. An entirely Indigenous cast, culturally specific POV and storyline, directed and written by an Indigenous woman, I mean hell, when does that happen? Although I play a very small role, I was hugely humbled and grateful to be a part of it. There were a couple of moments where I was watching a scene play out and thought “this is historical”. It was also a chance to reunite with old friends and colleagues who I hadn’t worked with in ages. Felt like I was surrounded by family.

@deanna.allison22 @natalie_benally @robertimesa #forrestgoodluck @kiowajgordon @insidelight @dizmihok

Rez Dogs - it’s been real. The first time the three of us sisters have worked together like this. Thank you @sterlinharjo - this was the best 50th birthday gift ever. It was deeply meaningful and I’m just so damn grateful for the opportunity. Farewell Tulsa, I love you, even though you’re unbearably hot. 

Thank you @tazbah for your leadership, friendship and for taking this photo. I can’t believe I didn’t take any!!

